import React from "react"

const TestForm = () => {
  const handleSubmit = (e) => {
    e.preventDefault()
  }
  return (
    <form>
      <input required={true}></input>
      <button onClick={(e) => handleSubmit(e)}>submit</button>
    </form>
  )
}
export default TestForm
